import{_ as e,o as i,c as t,O as r}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 23.1-2900 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/23.1-2900.md","filePath":"vacode/23.1-2900.md"}'),n={name:"vacode/23.1-2900.md"},a=r('<h1 id="§-23-1-2900-definitions" tabindex="-1">§ 23.1-2900 Definitions. <a class="header-anchor" href="#§-23-1-2900-definitions" aria-label="Permalink to &quot;§ 23.1-2900 Definitions.&quot;">​</a></h1><p>As used in this chapter, unless the context requires a different meaning:</p><p>&quot;Career and technical education&quot; means the training or retraining under public supervision and control that is (i) given in school classes, including field or laboratory work incidental to such training or retraining, exclusive of those career and technical education programs provided and administered by or through the public school system and (ii) conducted as part of a program designed to fit individuals for gainful employment as semiskilled or skilled workers or technicians in recognized occupations.</p><p>&quot;Chancellor&quot; means the Chancellor of the Virginia Community College System.</p><p>1966, c. 679, § 23-214; 1977, c. 413; 1998, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0111" target="_blank" rel="noreferrer">111</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?981+ful+CHAP0396" target="_blank" rel="noreferrer">396</a>; 2001, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?011+ful+CHAP0483" target="_blank" rel="noreferrer">483</a>; 2016, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0588" target="_blank" rel="noreferrer">588</a>.</p>',5),o=[a];function s(c,l,d,h,p,g){return i(),t("div",null,o)}const _=e(n,[["render",s]]);export{u as __pageData,_ as default};
